import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
        <div className="bg-red-500 flex items-center justify-center h-screen">
        <div className="bg-white h-96 shadow-md rounded-lg p-6">
          <h2 className="text-xl font-bold mb-4">Título do Card</h2>
          <p className="text-gray-600">Conteúdo do card...</p>
          <div className="mt-4">
            <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded mr-2">Botão 1</button>
            <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">Botão 2</button>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
